import React from "react";

const Rating = ({ value, text }) => {
  return (
    <div className="reting">
      <i
        className={
          value >= 1
            ? "fas fa-star"
            : value >= 0.5
            ? "fas fa-star-half-alt"
            : "fas fa-star"
        }
      ></i>
    </div>
  );
};

export default Rating;
